import 'package:equatable/equatable.dart';import 'package:intex_mobile_app/core/models/Catalog_model.dart';class Order extends Equatable {  late String? name; late  String? phone;  late String? address;  late String? order_number;  late int? status_id;  List<Bascet> bascet = [];  Order({required this.name,required this.phone,required this.address,    required this.bascet});  Map<String, dynamic> toJson() => {    "name": name,    "phone": phone,    "address": address,    "order_number": order_number = '0',    "status_id": status_id = 1,    "bascet": bascet,  };  @override  List<Object> get props => [];}class Bascet extends Equatable {  late int count;  late int product_id;  Bascet({required this.count,required this.product_id,required this.order_id,required this.location});  int order_id = 0;  late Cordinat location;  @override  List<Object?> get props => [];}class Cordinat extends Equatable {  late double latitude;  late double longitude;  Cordinat({    required this.latitude,    required this.longitude,  });  Map<String, dynamic> toJson() => {        "latitude": latitude = 1.000,        "longitude": longitude = 2.00000,      };  @override  List<Object?> get props => [];}